import Home from './components/Home';
import About from './components/About';
import Header from './components/Header';
import Portfolio from './components/Portfolio';
import Contact from './components/Contact';
import Resume from './components/Resume';
import Footer from './components/Footer';

import { BrowserRouter as Router, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

import './App.css';

function App() {
  return (

    <Router>

        { window.location.pathname !==  "/react-portfolio/" ? <Header />:""}
        <Route exact path="/react-portfolio/">
         <Home />
        </Route> 
        <Route exact path="/react-portfolio/about">
         <About />
        </Route>
        <Route exact path="/react-portfolio/portfolio">
         <Portfolio />
        </Route> 
        <Route exact path="/react-portfolio/contact" >
         <Contact />
        </Route> 
        <Route exact path="/react-portfolio/resume" >
         <Resume />
        </Route> 
        { window.location.pathname !==  "/react-portfolio/" ? <Footer />:""}  
    </Router>


  );
}

export default App;
